import React from "react";
import "./Navbar.css";

class Navbar extends React.Component {
    render () {
        return (
            <nav className="navbar">
                <span className="fl w-10 pa5"><a href="#">Option 1</a></span>
                <span className="fl w-10 pa5"><a href="#">Option 2</a></span>
                <span className="fl w-10 pa5"><a href="#">Option 3</a></span>
            </nav>
        )
    }
}

export default Navbar;
